import "./profile.css"
import React, {useEffect, useState} from "react";
import httpClient from "../../httpClient";
export default function Profile(){
    const [user,setUser] = useState( '')
    useEffect(()=>{
        (async () => {
            try {
                const resp = await httpClient.get("//127.0.0.1:5000/@me");
                setUser(resp.data);
            }
            catch (e){
                console.log("Not Authenticated.")
            }
        })();
    },[])
    return(

        <div className="profileItem">
            <span className="profileTitle">My Profile:</span>
            <span className="postTitle">{user.fullName}</span>
            <p className={"postContent"}>{user.email}</p>
            {/*<p className={"postDate"}>{user.date}</p>*/}
        </div>
    )
}
